import React from "react";
import Footer from "./Footer";
import "./home.css";
import { Login } from "./login";

const Home = () => {
  return (
    <>
      <div className="home">Send Money to India</div>
      <div className="text-center display-4 text- ">Internation Money Tranfers </div>

      <div></div>
      <Login />
      <Footer />
    </>
  );
};

export default Home;
